import React from "react";
import { Link } from "react-router-dom";

const LandingPage = () => {
  // You can add logic here to personalize content based on user state or other factors

  return (
    <div>
      <h1>Welcome to Task Manager</h1>
      <p>Personalized content for the user can go here.</p>
      <div>
        <Link to="/login">
          <button>Login</button>
        </Link>
        <Link to="/register">
          <button>Register</button>
        </Link>
      </div>
    </div>
  );
};

export default LandingPage;
